import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Header from "./components/Header/Header";
import Home from "./pages/Home/Home";
import Schedule from "./pages/Schedule/Schedule";
import Footer from "./components/Footer/Footer";
import Post from "./pages/Posts/Post";
import BackendHome from "./pages/BackendHome/BackendHome";
import LoginRegister from "./pages/LoginRegister/LoginRegister";
import { AuthProvider } from './context/Auth';
import PrivateRoute from './common/guards/PrivateRoute';
import './App.css';

function App() {
  return (
  <>
    <Router>
      <Header />
        <Switch>
          <Route exact path="/"  component={Home} />
          <Route path='/schedule' component={Schedule} />
        </Switch>
      <Footer />
    </Router>

    <AuthProvider>
      <Router>
        <Switch>
          <PrivateRoute exact path="/backendhome" component={BackendHome} />
          {/* <PrivateRoute path="/" exact  component = {AllBoards} /> */}
          {/* <PrivateRoute path="/createboard" component = {CreateBoard} /> */}
          {/* <PrivateRoute path="/board/:boardName" component = {Board} /> */}
          <PrivateRoute path='/Post' component={Post} />
          <Route path="/LoginRegister" component={LoginRegister} />
          {/* <Route exact path="*" component={Home} /> */}
        </Switch>
      </Router>
    </AuthProvider>
</>
  );
}

export default App;
